import * as React from 'react';
import JohnZoscak from '../images/John-Zoscak.png';

import {Fade} from 'react-reveal';
import { Typography } from '@material-ui/core';

const Header = (props) => {
  return (
    <header>
      <div className='header'>
        <Fade top>
          {/*<img src={JohnZoscak} alt='John Zoscak' />*/}
          <Typography variant='h4'>John Zoscak</Typography>
          <Typography variant='h1'>John Zoscak</Typography>
        </Fade>
      </div>
    </header>
  );
}
export default Header;
